def reverse_bits32(x):
    x = ((x & 0x55555555) << 1) | ((x >> 1) & 0x55555555)
    x = ((x & 0x33333333) << 2) | ((x >> 2) & 0x33333333)
    x = ((x & 0x0F0F0F0F) << 4) | ((x >> 4) & 0x0F0F0F0F)
    x = ((x & 0x00FF00FF) << 8) | ((x >> 8) & 0x00FF00FF)
    return ((x << 16) | (x >> 16)) & 0xffffffff

def calc_hash(apiname):
    apiname = apiname.encode("ascii")
    x = 0x171
    y = 0x1e2
    z = 499
    
    while (y < 0xa6 and (x == 0x58)) and (z == 0x4d):
        x = 0x59
        y = y + 1
        z = 0xed
    
    hash = 0xFFFFFFFF
    for c in apiname:
        reversed = reverse_bits32(c)
        for j in range(8):
            if ((hash ^ reversed) & 0x80000000) != 0:
                hash = ((hash << 1) ^ 0x4c11db7) & 0xFFFFFFFF
            else:
                hash = (hash << 1) & 0xFFFFFFFF
            reversed = (reversed << 1) & 0xFFFFFFFF
    
    return reverse_bits32((~hash) & 0xFFFFFFFF)


def find_api_for_hash(req_hash):
    api_lists = {'wininet.dll': api_list_wininet,
                'ntdll.dll' : api_list_ntdll,
                'kernel32.dll' : api_list_kernel32, 
                'advapi32.dll' : api_list_advapi32, 
                'sqlite3.dll' : api_list_sqlite3,
                'user32.dll' : api_list_user32,
                'msvcrt.dll' : api_list_msvcrt,
                'shell32.dll' : api_list_shell32,
                'rpcrt4.dll' : api_list_rpcrt4,
                'modules' : modules, 
                'wmp.dll' : api_list_wmp,
                'processes' : processes,
                'av_vendor' : security_vendor_files,
                'system32_dll' : system32_dll,
                'misc' : misc}
    for dllname, api_list in api_lists.items():
        for apiname in api_list:
            if calc_hash(apiname) == req_hash:
                return dllname + '.' + apiname
    return None

